onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 8;
   发射效果 = "枪火";
   子弹种类 = "穿刺子弹";
   子弹威力 = 330;
   子弹速度 = 40;
   击中地图效果 = "火花";
   Z轴攻击范围 = 30;
   击倒率 = 10;
   击中后子弹的效果 = "";
   击退初速度 = 12;
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果,击退初速度);
}

